import React from "react";
import {
  BrowserRouter as Router,
  Link
} from "react-router-dom"; 
import images from "../pages/Projects/images";


export function LinkList ({root, lis}) {
  let elements = [];
  lis.forEach((li, i) => {
    elements.push(
      <li key={i}>
      <Link to={`${root}/${li.name}`}>
        {li.name}
        {li.thumb}
        {images}
        <img src={li.thumb} />
      </Link>
      </li>
    );
  });
  return(
    <ul>
      {elements}
    </ul>
  );
}

